<p><hi rend="bold">كۈنمىڭ شەھىرى</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/جۇڭگو">جۇڭگو</ref> <ref target="https://ug.wikipedia.org/wiki/يۈننەن_ئۆلكىسى">يۈننەن ئۆلكىسى</ref> دىكىبىخاھار 2008 نوپۇس بار، كۈنمىڭنىڭ 6،193،300 نوپۇسىبار، 288.4 كم² دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 25.04°، خارىكى ئۇزۇنلۇك 102°41، پوقتانومۇرى 650000 رايۇننومۇرى 0871.</p>
